import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';

export const reportVehicles = (vehicles, mechanicalPendences) => {

    pdfMake.vfs = pdfFonts.pdfMake.vfs;

    const vehiclesData = Object.keys(vehicles).map((vehicle) => {

            const vehicleName = () => {
                return (vehicles[vehicle].marca).toUpperCase() + ' ' + (vehicles[vehicle].modelo).toUpperCase();
            };   
            return(
            Object.keys(mechanicalPendences).map((pendence) => {
                return [
                {text: (vehicles[vehicle].placa).toUpperCase(), fontSize: 10,margin: [0,3,0,3]},
                {text: vehicleName(), fontSize: 10,margin: [0,3,0,3]},
                {text: mechanicalPendences[vehicle], fontSize: 10,margin: [0,3,0,3]},
                ]
            })
            );

        
    });

    const cabecalho = [
            {
            image: `data:image/png;base64,`,
            width: 215,
            margin: [0, 30, 0, 10],
            alignment: 'center'
        }                              
    ];

    const corpo = {
        margin: [0, 90, 0, 0],
        layout:{ 
            hLineColor: '#a6a6a6',
            vLineColor: '#a6a6a6',
            vLineWidth: (i) => {
                return .05
            },
            hLineWidth: (i) => {
                return .05
            }

        },
        table: {
        widths: [52, 'auto', 55, '*', 45, 120, 70, 40],
        heights: 20,
        headerRows: 2,
        body : [
            [
                {text: 'Relatrio de Pendncias Mecnicas', fontSize: 12, colSpan: 8, style: 'tableHeader', alignment: 'center', bold: true, fillColor: '#474747', hLineWidth: .5, color: 'white', margin: [0,3,0,3]},
                {},
                {},
                {},
                {},
                {},
                {},
                {}
            ],
            [
                {text: 'Placa', fontSize: 11, bold: true, fillColor: '#474747', color: 'white', margin: [0,3,0,3]},
                {text: 'Marca/Modelo', fontSize: 11, bold: true, fillColor: '#474747', color: 'white', margin: [0,3,0,3]},
                {text: 'Descrio', fontSize: 11, bold: true, fillColor: '#474747', color: 'white', margin: [0,3,0,3]},

            ],
            ...vehiclesData
        ]    
        }
        
    };

    const rodape = [];


    const docDefinitions = {
        pageSize : 'A4',
        pageOrientation: 'landscape',
        pageMargins: [10, 20, 10, 35],
        alignment: 'center',

        header: [cabecalho],
        content: [corpo],
        footer: [rodape]
    };

    pdfMake.createPdf(docDefinitions).open();


}